PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "app_comment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content" text NOT NULL, "updated_at" datetime NOT NULL, "created_at" datetime NOT NULL, "article_id" bigint NOT NULL REFERENCES "app_article" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "app_user" ("id") DEFERRABLE INITIALLY DEFERRED, "is_approved" bool NOT NULL);
COMMIT;
